[{"location":"","page":"Home","title":"Home","text":"CurrentModule = Dodds_Watts_model","category":"page"},{"location":"#Dodds*Watts*model","page":"Home","title":"DoddsWattsmodel","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for DoddsWattsmodel.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [Dodds_Watts_model]","category":"page"},{"location":"#Dodds_Watts_model.Agent","page":"Home","title":"Dodds_Watts_model.Agent","text":"Definition of the individual agents\n\ntype 1: Susceptible type 2: Infected type 3: Removed\n\ndose: Count of received dosages\n\nthreshold: individual dose threshold; if the agents exceeds its threshold, it becomes infected\n\nvaccine: Vaccinated yes or no\n\n\n\n\n\n","category":"type"},{"location":"#Dodds_Watts_model.fixed_point_curve_cmm-Tuple{Int64, Int64}","page":"Home","title":"Dodds_Watts_model.fixed_point_curve_cmm","text":"Plots the fixed point curve for the critical mass model according to the memory T and threshold d\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.fixed_point_curve_etm-Tuple{Int64, Float64}","page":"Home","title":"Dodds_Watts_model.fixed_point_curve_etm","text":"Plots the stable fixed point curve of the epidemic threshold model according to the memory T and recovery rate r\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.initialize_cmm-Tuple{Int64, Int64, Int64}","page":"Home","title":"Dodds_Watts_model.initialize_cmm","text":"Initializes N agents with threshold d, where I are infected for the critical mass model\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.initialize_etm-Tuple{Int64, Int64}","page":"Home","title":"Dodds_Watts_model.initialize_etm","text":"Initializes N agents, where I are infected for the epidemic threshold model\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.initialize_universal-Tuple{Int64, Int64}","page":"Home","title":"Dodds_Watts_model.initialize_universal","text":"Initializes N agents, where I are infected for the epidemic threhsold model. The threshold distribution is set to Gamma(1,1)\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.plot_model_cmm-Tuple{Int64, Int64, Int64, Int64, Int64, Float64, Int64, Float64, Float64, Int64}","page":"Home","title":"Dodds_Watts_model.plot_model_cmm","text":"Plots a simulation of the critical mass model for t timesteps, N individuals, S suscpetibles, I infected, R recoverd, exposure probability p, memory T, recovery rate r, probabiltiy imunity loss ρ, threshold d\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.plot_model_etm-Tuple{Int64, Int64, Int64, Int64, Int64, Float64, Int64, Float64, Float64}","page":"Home","title":"Dodds_Watts_model.plot_model_etm","text":"Plots a simulation of the epidemic threshold model for t timesteps, N individuals, S suscpetibles, I infected, R recoverd, exposure probability p, memory T, recovery rate r, probabiltiy imunity loss ρ\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.plot_model_network-Tuple{Int64, Int64, Int64, Int64, Int64, Float64, Int64, Float64, Float64, Any, Any}","page":"Home","title":"Dodds_Watts_model.plot_model_network","text":"Plots a simulation of the network model for t timesteps, N individuals, S suscpetibles, I infected, R recoverd, exposure probability p, memory T, recovery rate r, probabiltiy imunity loss ρ and network g The variable version determines the underlying model: \"etm\" = epidemic threshold model \"ciritical\" = critical mass model \"universal\" = heterogeneity model\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.plot_model_periodic-Tuple{Int64, Int64, Int64, Int64, Int64, Any, Int64, Float64, Float64, Any, Any}","page":"Home","title":"Dodds_Watts_model.plot_model_periodic","text":"Plots a simulation of the periodic model for t timesteps, N individuals, S suscpetibles, I infected, R recoverd, periodic exposure distribution p(t) with period P, memory T, recovery rate r, probabiltiy imunity loss ρ The variable version determines the underlying model: \"etm\" = epidemic threshold model \"ciritical\" = critical mass model \"universal\" = heterogeneity model\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.plot_model_universal-Tuple{Int64, Int64, Int64, Int64, Int64, Float64, Int64, Float64, Float64}","page":"Home","title":"Dodds_Watts_model.plot_model_universal","text":"Plots a simulation of the heterogeneity model for t timesteps, N individuals, S suscpetibles, I infected, R recoverd, exposure probability p, memory T, recovery rate r, probabiltiy imunity loss ρ\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.plot_model_vacc-Tuple{Int64, Int64, Int64, Int64, Int64, Float64, Int64, Float64, Float64, Float64, Int64, Any}","page":"Home","title":"Dodds_Watts_model.plot_model_vacc","text":"Plots a simulation of the vaccination model for t timesteps, N individuals, S suscpetibles, I infected, R recoverd, exposure probability p, memory T, recovery rate r, probabiltiy imunity loss ρ, vaccination rate v and strength s The vaccination rate determines how many of the agents are being vaccinated. Their threshold will be raised by the vaccine strength s. The variable version determines the underlying model: \"etm\" = epidemic threshold model \"ciritical\" = critical mass model \"universal\" = heterogeneity model\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.plot_network-Tuple{Any}","page":"Home","title":"Dodds_Watts_model.plot_network","text":"Plots an embedding of the network g\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.plot_ode-Tuple{Int64, Float64, Float64}","page":"Home","title":"Dodds_Watts_model.plot_ode","text":"Plots the corresponding ODE to the epidemic threshold model with N individuals, exposure probability p and recovery rate r\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.timestep_cmm-Tuple{Vector{Dodds_Watts_model.Agent}, Int64, Array{Int64}, Array{Int64}, Array{Int64}, Float64, Int64, Float64, Float64}","page":"Home","title":"Dodds_Watts_model.timestep_cmm","text":"Performs a time step for the critical mass model\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.timestep_etm-Tuple{Vector{Dodds_Watts_model.Agent}, Int64, Array{Int64}, Array{Int64}, Array{Int64}, Float64, Int64, Float64, Float64}","page":"Home","title":"Dodds_Watts_model.timestep_etm","text":"Performs a time step for the epidemic threshold model\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.timestep_network-Tuple{Vector{Dodds_Watts_model.Agent}, Int64, Array{Int64}, Array{Int64}, Array{Int64}, Float64, Int64, Float64, Float64, Any}","page":"Home","title":"Dodds_Watts_model.timestep_network","text":"Performs a time step for the Dodds-Watts model with a network g\n\n\n\n\n\n","category":"method"},{"location":"#Dodds_Watts_model.timestep_universal-Tuple{Vector{Dodds_Watts_model.Agent}, Int64, Array{Int64}, Array{Int64}, Array{Int64}, Float64, Int64, Float64, Float64}","page":"Home","title":"Dodds_Watts_model.timestep_universal","text":"Performs a time step for the heterogeneity model. The dose distribution is set to LogNormal()\n\n\n\n\n\n","category":"method"}]
